  false,\n\t\"url\": null,\n\t\"notes\": \"The Bureau of Reclamation (Reclamation)
  surveyed Lake Estes in August of 2001 to develop a topographic map and compute a
  present storage-elevation relationship (area-capacity tables). The data were used
  to calculate reservoir capacity lost due torsediment accumulation since dam closure
  in November of 1948.  The underwater survey was conducted between lake elevation
  and project datum.  The underwater survey used sonic depth recording equipment interfaced
  with a global positioning system (GPS) that gave continous sounding positions throughout
  the underwater. portions of the reservoir covered by the survey vessel.  The above-water
  topography was determined by digitizing the developed contour lines from the U.S.
  Geological Survey quadrangle maps of the reservoir area.  The new topographic map
  of Lake Estes was developed from the combined digitized USGS quadrangle contours
  and August 2001 underwater measured topography.  This study assumed no change from
  elevation 7470.0 feet and above.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
